        <Stack.Screen name = "RegisterScreen" component = {RegisterScreen} />
        {/*<Stack.Screen name = "UpdateScreen" component = {UpdateProfile} />
      </Stack.Navigator>*/}
      <Text>State dispatch({logging_in()})</Text>
    </NavigationContainer>
    </Provider>
  );
}
